function open_infowindow(map, marker, infowindow) {
    f = function(map, marker, infowindow) {
        return function() {
            if ( infowindow_is_open(infowindow) )
                return;
            infowindow.open(map, marker);
        };
    };
    return f(map, marker, infowindow)
}

function close_infowindow(infowindow) {
    f = function(infowindow) {
        return function() {
            if ( ! infowindow_is_open(infowindow) )
                return;
            infowindow.close();
        };
    };
    return f(infowindow)
}

var LAST_WINDOW = null;
function toggle_infowindow(map, marker, infowindow) {
    f = function(map, marker, infowindow) {
        return function() {
            if ( infowindow_is_open(infowindow) ) {
                infowindow.close();
                LAST_WINDOW = null;
            }
            else {
                if ( LAST_WINDOW )
                    LAST_WINDOW.close();
                infowindow.open(map, marker);
                LAST_WINDOW = infowindow;
            }
        }
    };
    return f(map, marker, infowindow)
}

function infowindow_is_open(iw){
    if ( ! iw )
        return false;
    var map = iw.getMap();
    return (map !== null && typeof map !== "undefined");
}

function initMap() {

    var zoom = 17;
    var map = new google.maps.Map(document.getElementById('map'), {
        center: WW_CENTER,
        zoom: zoom,
    });

    // Draw boundary
    var path = WW_BOUNDARY_POINTS.map( function(pair) { return { lat: pair[0], lng: pair[1] }; } );
    var boundary = new google.maps.Polygon({
        path: path,
        geodesic: true,
        strokeColor: '#FF0000',
        strokeOpacity: 0.2,
        strokeWeight: 5,
        fillColor: '#8080FF',
        fillOpacity: 0.08,
    });
    boundary.setMap(map);

    // Set options
    var styles = [ { featureType: "poi", elementType: "labels", stylers: [ { visibility: "off" } ] } ];
    var opts = { mapTypeId: google.maps.MapTypeId.ROADMAP, styles: styles };
    map.setOptions(opts);

    /*
    // Zoom to fit
    bounding_rect = new google.maps.LatLngBounds(WW_BOUNDARY_SW, WW_BOUNDARY_NE);
    map.fitBounds(bounding_rect);

    // Set markers
    markers(map);
}

            var namestr = name + ' (' + party + ')';
            if ( color )
                namestr = '<font color="' + color + '">' + namestr + '</font>';
            if ( vstr )
                vstr += '<br/>';
            vstr += namestr;
        }

        // Marker label letter and color
        var n_tot = n_d + n_r + n_o;
        var label_letter = 'dot';
        var label_color = 'purple';
        if ( n_d > 0 && n_r == 0 )
            label_color = 'blue';
        else if ( n_r > 0 && n_d == 0 )
            label_color = 'red';
        else if ( n_r == 0 && n_d == 0 )
            label_color = 'yellow';
        else
            label_color = 'purple';

        var content = "<b>" + title + "</b></br>" + vstr;
        var position = { lat: lat, lng: lng };
        var icon = 'https://maps.google.com/mapfiles/ms/icons/' + label_color + '-dot.png';
        // var marker = new google.maps.Marker({ position: position, map: map, title: title, icon: icon });
        var marker = new google.maps.Marker({ position: position, map: map, icon: icon });
        var offset = new google.maps.Size(0,-5);
        var infowindow = new google.maps.InfoWindow( { content: content, disableAutoPan: false, pixelOffset: offset } );
        marker.addListener('click', toggle_infowindow(map, marker, infowindow));
        marker.addListener('mouseover', open_infowindow(map, marker, infowindow));
        marker.addListener('mouseout', close_infowindow(infowindow));
    }
}
